INSERT INTO `houses` (`house_id`, `house_name`, `house_location`, `house_reviews`, `house_features`, `house_kitchen`, `house_baths`, `house_toilets`, `house_rooms`, `house_garage`, `house_short_desc`, `house_long_desc`, `house_max_guest`, `house_amenities`, `house_HeroImg`, `house_img1`, `house_img2`, `house_img3`, `house_img4`, `house_status`) VALUES
(1, 'Barlings Beach Luxury Townhouse', 'Bralings Beach, Sydney , Australia', '4.7(62)', '\r\n					<p>\r\n							<i class=\"fas fa-home\"></i> Entire house <br>\r\n							You will have the house to yourself.\r\n\r\n						</p>\r\n<p>\r\n							<i class=\"fas fa-male\"></i> <i class=\"fas fa-female\"></i> 2 couples <br>\r\n							The accommodation is for a maximum of 2 couples\r\n						</p>\r\n						\r\n						<p>\r\n							<i class=\"fas fa-smoking-ban\"></i> No Smoking Policy <br>\r\n							The townhouse is strictly non-smoking\r\n						</p>\r\n						<p>\r\n							<i class=\"fas fa-cat\"></i> <i class=\"fas fa-dog\"></i> Pet friendly Policy <br>\r\n							The townhouse is pet-friendly\r\n						</p>\r\n						<p>\r\n							<i class=\"fas fa-wifi\"></i> Free Wifi <br>\r\n							Unlimited wifi is available throughout your stay\r\n						</p>\r\n						<p>\r\n							<i class=\"fas fa-broom\"></i>\r\n							Clean and tidy <br>\r\n							The cleaning service is as indicated unless alternatives are negotiated before your arrival\r\n\r\n						</p>', 1, 2, 3, 2, 1, 'Our luxury 2 Bedroom Townhouse has views from the deck and it&apos;s just 2 minutes walk to the beach', '\r\nThe townhouse offers a spacious living area with a leather lounge suite that overlooks a sun drenched,\r\ntree-filled garden. A separate kitchen has everything you need to make your stay relaxed and\r\ncomfortable\r\nTVs in the loungeroom and in each bedroom are sure to make everyone happy. An undercover BBQ area\r\nwith seating offers plenty of space to stretch out and enjoy that cup of freshly brewed coffee or a glass\r\nof wine\r\nEach bedroom has a Queen bed and spacious en-suite facilities. Plus there is a powder room for general\r\nuse\r\nA daily cleaning service provides a general tidy-up of the kitchen and bathrooms. This cleaning service\r\nalso includes a changeover of towels and bedding on every third day of your stay in our luxuriously\r\nappointed townhouse\r\nThis is the perfect place for your luxury home-away-from-home holiday', 4, '	<div class=\"row\">\r\n							<div class=\"column\">\r\n\r\n								<div>\r\n									<i class=\"fas fa-thermometer-quarter\"></i>\r\n									<p>Heating</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-parking\"></i>\r\n									<p>Free parking on premises</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-utensils\"></i>\r\n									<p>Kitchen</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-door-open\"></i>\r\n									<p>Private entrance</p>\r\n								</div>\r\n							</div>\r\n							<div class=\"column\">\r\n								<div>\r\n									<i class=\"fas fa-smoking-ban\"></i>\r\n									<p>Smoke alarm</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-fan\"></i>\r\n									<p>Air conditioning</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-tv\"></i>\r\n									<p>TVs in the loungeroom</p>\r\n								</div>\r\n\r\n\r\n\r\n							</div>\r\n						</div>\r\n\r\n					</div>', 'images/luxury_townhouse.jpeg', 'images/entrance_townhouse.jpg', 'images/single_bedroom.jpg', 'images/kitchen_livingroom.jpg', 'images/kitchen2.jpg', 1),
(2, 'Barlings Beach Seaside Holiday House', 'Bralings Beach, Sydney , Australia', '4.7(62)', '\r\n				\r\n			<p>\r\n							<i class=\"fas fa-home\"></i> Entire house <br>\r\n							You will have the house to yourself.\r\n\r\n						</p>\r\n<p>\r\n							<i class=\"fas fa-male\"></i> <i class=\"fas fa-female\"></i> 4-6 people <br>\r\n							The accommodation is for  2-6 people\r\n						</p>\r\n					\r\n						<p>\r\n							<i class=\"fas fa-smoking-ban\"></i> No Smoking Policy <br>\r\n							The townhouse is strictly non-smoking\r\n						</p>\r\n						<p>\r\n							<i class=\"fas fa-tv\"></i>A large TV in the living room <br>\r\n							There is a large TV in the living room along with a DVD player and a selection of movies\r\n						</p>\r\n						<p>\r\n							<i class=\"fas fa-wifi\"></i> Free Wifi <br>\r\n							 Unlimited wifi is\r\nprovided in the accommodation fee\r\n						</p>\r\n						<p>\r\n							<i class=\"fas fa-broom\"></i>\r\n							Clean and tidy <br>\r\n							A twice-weekly cleaning service includes a general tidy-up of the kitchen and bathrooms plus a weekly\r\nreplacement of towels and bedding\r\n\r\n						</p>\r\n					', 1, 2, 2, 3, 1, 'It offers accommodation with three bedrooms and two bathrooms for 2-6 people. Sit back and relax. Read a book, go for a walk along the beach, catch some waves or have a sleep-in. It&apos;s\r\nyour private space to enjoy.', 'This comfortable house has direct access to the beach through a gate in the backyard\r\nIt offers accommodation with three bedrooms and two bathrooms for 4-6 people. The master bedroom\r\nhas a Queen bed and an en-suite bathroom, the second bedroom has a Queen bed that can be\r\nseparated into two large single beds, and the third bedroom has bunk beds for 2 singles.\r\nThe generous, open plan living area and kitchen looks over a water-wise garden of native plantings. You\r\ncan relax indoors or laze away your time in this shaded garden\r\nThere is a large TV in the living room along with a DVD player and a selection of movies. Unlimited wifi is\r\nprovided in the accommodation fee\r\nSit back and relax. Read a book, go for a walk along the beach, catch some waves or have a sleep-in. It&apos;s\r\nyour private space to enjoy\r\nA twice-weekly cleaning service includes a general tidy-up of the kitchen and bathrooms plus a weekly\r\nreplacement of towels and bedding', 6, '	<div class=\"row\">\r\n							<div class=\"column\">\r\n\r\n								<div>\r\n									<i class=\"fas fa-thermometer-quarter\"></i>\r\n									<p>Heating</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-parking\"></i>\r\n									<p>Free parking on premises</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-utensils\"></i>\r\n									<p>Kitchen</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-door-open\"></i>\r\n									<p>Private entrance</p>\r\n								</div>\r\n							</div>\r\n							<div class=\"column\">\r\n								<div>\r\n									<i class=\"fas fa-smoking-ban\"></i>\r\n									<p>Smoke alarm</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-fan\"></i>\r\n									<p>Air conditioning</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-tv\"></i>\r\n									<p>TVs in the loungeroom</p>\r\n								</div>\r\n\r\n\r\n\r\n							</div>\r\n						</div>\r\n\r\n					</div>', 'images/holidayHouse.jpg', 'images/fireplace.jpg', 'images/bedroom1.jpg', 'images/toilet1.jpg', 'images/kitchen1.jpg', 1),
(3, 'Barlings beach shack', 'Bralings Beach, Sydney , Australia', '4.7', '\r\n<p><i class=\"fas fa-home\"></i> Entire house <br> You will have the house to yourself.</p>\r\n<p><i class=\"fas fa-male\"></i> <i class=\"fas fa-female\"></i> 8 Guest<br>The accommodation is for a maximum of 8 people</p><p><i class=\"fas fa-smoking-ban\"></i> No Smoking Policy <br>\r\nThe townhouse is strictly non-smoking</p><p><i class=\"fas fa-couch\"></i><i class=\"fas fa-tv\"></i>A large TV & couches in the living room <br>An open plan living area has comfy couches, a cinema tv and a kitchen area with the basics you need to make your stay relaxed and comfortable</p><p>\r\n<i class=\"fas fa-wifi\"></i> Free Wifi <br>Unlimited wifi is provided in the accommodation fee </p><p><i class=\"fas fa-broom\"></i>Clean and tidy <br>A weekly cleaning service provides a general tidy-up of the kitchen and bathroom. This cleaning service includes removal of rubbish and a changeover of towels and bedding\r\n</p>\r\n					', 1, 2, 3, 3, 1, 'Comfortable.. There are wonderful views over the water with\r\ndirect access to a dog-friendly beach 3 Bedroom House with lots of character', ' It has a large veranda for lazing away your holiday time. There&apos;s\r\nplenty of space for you to enjoy bbqs and sunset drinks at the end of each day\r\nIt is just 10 minutes&apos; walk, or a short drive, to a restaurant, cafes and other essential shopping needs at\r\nBarlings Beach\r\nThe centrally-located bathroom has a full-size bath, a separate shower, a toilet and plenty of hanging\r\nspace for all your beach towels. There is an outdoor shower for use at the end of each visit to the beach\r\nAn open plan living area has comfy couches, a cinema tv and a kitchen area with the basics you need to\r\nmake your stay relaxed and comfortable\r\nA weekly cleaning service provides a general tidy-up of the kitchen and bathroom. This cleaning service\r\nincludes removal of rubbish and a changeover of towels and bedding\r\nThis is a character-filled place for you to enjoy a casual, memorable beach holiday with family and\r\nfriends', 8, '	<div class=\"row\">\r\n							<div class=\"column\">\r\n\r\n								<div>\r\n									<i class=\"fas fa-cocktail\"></i>\r\n									<p>enjoy sunset drinks at the end of each day</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-dog\"></i>\r\n									<p>There are wonderful views over the water with direct access to a dog-friendly beach.</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-utensils\"></i>\r\n									<p>Kitchen</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-door-open\"></i>\r\n									<p>Private entrance</p>\r\n								</div>\r\n							</div>\r\n							<div class=\"column\">\r\n								<div>\r\n									<i class=\"fas fa-smoking-ban\"></i>\r\n									<p>Smoke alarm</p>\r\n								</div>\r\n								<div>\r\n									<i class=\"fas fa-fan\"></i>\r\n									<p>Air conditioning</p>\r\n								</div>\r\n							\r\n\r\n\r\n\r\n							</div>\r\n						</div>\r\n\r\n					</div>', 'images/shack.jfif', 'images/green-plant-on-white-wooden-table-3644742.jpg', 'images/bedroom1.jpg', 'images/shower2.jpg', 'images/single_bedroom.jpg', 1);
