INSERT INTO `house_reviews` (`house_id`, `review_id`, `user_pic`, `user_comment`, `user_name`, `added_on`, `rating`) VALUES
(1, 1, 'images/fb5.jpg', 'house is so big, i fell in love with it wish i could stay longer there', 'tania', '2020-11-02 22:16:40', 4.2),
(1, 2, 'images/fb6.jpg', 'the best part was the bbq area in the house, and the spacious tv lounge', 'steve', '2020-11-02 22:16:40', 4.1),
(2, 3, 'images/fb7.jfif\r\n', 'It was a prime location n great for family, Right opposite the beach.  Lovely and peaceful and a lovely pool/BBQ area\r\n\r\n', 'Vanessa', '2020-11-02 22:16:40', 3.7),
(2, 4, 'images/fb8.jfif\r\n', 'Very clean, comfortable, and ideal for a peaceful relaxing break. Beautiful location opposite the beach.... Very well equipped beach house with gas stove, dishwasher, washing machine/dryer and air con. Even spotted a kangaroo on the front lawn one night', 'Jodie', '2020-11-02 22:16:40', 2.8),
(1, 5, 'images/fb10.jfif', 'i loved my stay there', 'Marium', '2020-11-02 22:16:40', 3.7),
(3, 6, 'images/fb9.jfif', 'A perfect house in a perfect location. Our family of four thoroughly enjoyed our stay and will definitely be back.', 'jodie', '2020-11-02 22:16:40', 4.7),
(3, 7, 'images/pic.jfif', 'The little blue house was perfect. Immaculate and clean and a great location to stay at. We will definitely be back again. Thank you so much.', 'Chelsea', '2020-11-02 22:16:40', 4.6),
(3, 8, 'images/person.jfif', 'Such a fabulous location. Exactly what we were looking for - close to the beach, perfectly clean and very comfortable. Would recommend and will hopefully visit again.', 'thomas', '2020-11-02 22:16:40', 4.2),
(3, 9, 'images/person1.jfif', 'Great place! Super easy to stay in, comfortable, we had so much fun!', 'sam', '2020-11-02 22:16:40', 4.1),
(3, 21, 'images/', 'We had a great time at the studio during the long weekend. Itâ€™s a beautiful place, very nicely decorated and at a perfect location, walking distance to the beach', 'Sara', '2020-11-07 14:18:47', 4.4),
(1, 26, 'images/', 'test', 'test', '2020-11-07 17:06:36', 4);
